import re
import math
import time
class Marble(object):
    def __init__(self, id, color, name, weight):
        self.id     = id
        self.color  = color
        self.name   = name
        self.weight = weight
    def organize(a):
        color_key =["red", "orange", "yellow", "green", "blue", "indigo", "violet"]
        organized_by_color = []
        for i in color_key:
            for ii in a:
                if i == ii.color:
                    organized_by_color.append(ii)
        Marble.remove_by_weight(organized_by_color)
    def remove_by_weight(b):
        filtered_by_weight = []
        for i in b:
            if i.weight >= 0.5:
                filtered_by_weight.append(i)
        Marble.is_palindrum(filtered_by_weight)
    def is_palindrum(c):
        final_group=[]
        for i in c:
            current=(i.name).lower().replace(" ", "")
            current_filtered=re.sub(r'[^\w\s]','',current)
            current_reversed="".join(reversed(current_filtered))
            if current_filtered == current_reversed:
                final_group.append(i)
        Marble.display(final_group)
    def display(d):
        filtered_list = []
        print("This is the filtered list per request: ")
        for i in d:
            print("Marble:" + " Id: " + str(i.id) + ", Color: " + i.color + ", Name: " + i.name + ", Weight: " + str(i.weight) + ".")
            filtered_list.append(i)
        return filtered_list

